const Footer = () =>{
    return(
        <footer className="footer mt-auto py-3 bg-primary">
            <div className="container">
                <p className="text-light"><small><strong>AKA SYSTEM</strong><br/>
                <p className="text-light">App desenvolvido por <a href="https://github.com/lucasrodrigues19" target="_blank" rel="noreferrer">Lucas Rodrigues</a></p>
                Evento promovido pela escola DevSuperior: <a href="https://instagram.com/lucas_pereira.20" target="_blank" rel="noreferrer">@lucas_rodrigues.20</a></small></p>
            </div>
        </footer>
    );
}
export default Footer;
